lyrics:
 Your name is big brother,
 You say that you're watch-ing me on the tele;
Seeing me go no-where.
 Your name is big brother,
 You say that you're tired of me pro-testing;
 Children dying every-day.
 My name is no-body,
But I can't wait to  see your face, inside my door.
 Your name is big brother,
 You say that you got me all in your notebook;
 Writing it down every-day.
 Your name is I'll see ya,
 I'll change, if you vote me in as the Pres;
The President of your soul.
 I live in the Ghetto;
 You just come to  visit me 'round election time.
 I live in the Ghetto;
 Some-day I  will move on my feet to the other side.
 My name is se-cluded,
 We live in a house the size of a matchbox,
 Roaches live with us wall to wall.
 You've killed all our leaders;
 I don't even have to do nothin' to you;
You'll cause your own country to fall.
